I have a Tooltip component that is used in different places in my NextJS application. However, I want to ensure that when a new Tooltip is opened, any previously opened Tooltip is closed. Since these Tooltips don't have a shared scope or context, they are isolated from each other. How can I achieve this using React Context?

To achieve this, you can create a React Context to manage the state of the Tooltips. This context will keep track of the currently open Tooltip and provide a way to close any previously open Tooltip when a new one is opened.

Here's a step-by-step guide to implement this:

1. **Create the Tooltip Context:**

First, create a new file `TooltipContext.js` to define the context and its provider.

```javascript
import React, { createContext, useState, useContext } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [openTooltipId, setOpenTooltipId] = useState(null);

  const openTooltip = (id) => {
    setOpenTooltipId(id);
  };

  const closeTooltip = () => {
    setOpenTooltipId(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltipId, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => {
  return useContext(TooltipContext);
};
```

2. **Wrap your application with the TooltipProvider:**

In your `_app.js` file, wrap your application with the `TooltipProvider`.

```javascript
import { TooltipProvider } from '../context/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```

3. **Create the Tooltip Component:**

Now, create the `Tooltip` component that uses the context to manage its state.

```javascript
